import React, { useState } from 'react';

const Baji = () => {
    const tabs = ['Overview','ক্রিকেট','লাইভ ক্যাসিনো','স্লট গেম','টেবিল গেম',' স্পোর্টস','মাছ ধরা']
    const [activeTab,setActiveTab]=useState('Overview');
    const overviewColumns = [
        "তারিখ",
        "Bet Count",
        "Bet Amount",
        "জয় পরাজয়",
        "Jackpot Contribution",
        "Jackpot Amount",
      ];
      const commonColumns = [
        "Column 1",
        "Column 2",
        "Column 3",
        "Column 4",
        "Column 5",
        "Column 6",
      ];
    return (
        <div>
            <div className="flex space-x-2 mb-4">
        {tabs.map((tab, index) => (
          <button
            key={index}
            className={`px-4 py-2 rounded ${
              activeTab === tab ? "bg-blue-500 text-white" : "bg-gray-200"
            }`}
            onClick={() => setActiveTab(tab)}
          >
            {tab}
          </button>
        ))}
      </div>
        </div>
    );
};

export default Baji;
